import{_ as e,o as t,c as r,O as a}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 55.1-2419 Order of sale by Governor.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/55.1-2419.md","filePath":"vacode/55.1-2419.md"}'),o={name:"vacode/55.1-2419.md"},i=a('<h1 id="§-55-1-2419-order-of-sale-by-governor" tabindex="-1">§ 55.1-2419 Order of sale by Governor. <a class="header-anchor" href="#§-55-1-2419-order-of-sale-by-governor" aria-label="Permalink to &quot;§ 55.1-2419 Order of sale by Governor.&quot;">​</a></h1><p>Not less than six months after the publication of the escheator&#39;s certificate pursuant to § <a href="/vacode/55.1-2418/">55.1-2418</a>, the State Treasurer shall present to the Governor the escheator&#39;s certificate and proof of publication, and, if a claim has not been made pursuant to § <a href="/vacode/55.1-2409/">55.1-2409</a>, or, if made, has been decided in favor of the Commonwealth, the Governor shall order the escheated land to be sold upon such terms, at such time, and at such place within the county or city in which the property is located, or if the property is located within a city that is located wholly within a county, then the sale may take place in the city, or a contiguous county or city as he deems proper. The order of sale shall be delivered to the State Treasurer, to be transmitted to the escheator, who shall proceed to sell according to such order.</p><p>1977, c. 583, § 55-184.1; 1981, c. 514; 1982, c. 486; 1996, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0256" target="_blank" rel="noreferrer">256</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0551" target="_blank" rel="noreferrer">551</a>; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0712" target="_blank" rel="noreferrer">712</a>.</p>',3),n=[i];function c(s,h,l,d,f,p){return t(),r("div",null,n)}const v=e(o,[["render",c]]);export{u as __pageData,v as default};
